import React from "react";
import catHeader from "../../images/cat-header.png";

const Navbar = () => {
  return (
    <>
      <nav>
        <div className="">
          <img src={catHeader} alt="Cat Header " className="brightness-50 " />
        </div>
        <div className="absolute  top-0 left-0  flex  pt-6 w-full bg-slate-200">
          <h1 className="text-4xl font-bold text-white px-10 align-center">
            CatLy
          </h1>
          <ul className="flex px-10 text-white text-center align-center justify-center">
            <li className="px-4">Home</li>
            <li className="px-4">About Us</li>
            <li className="px-4">Contact</li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
